import React, {memo} from 'react';
import styled from 'styled-components';
import dataset from '../dataset';

const HeaderContainer = styled.div`
    background-color: #f605;
    width:100%;
    padding:0 100px;
    height:80px;
`;

const Header = memo(() => {
  return (
    <HeaderContainer>
      <h1>Header</h1>
    </HeaderContainer>
  );
});

export default Header;
